const canvas = document.getElementById('canvas1')
const ctx = canvas.getContext('2d')
const image1 = new Image()
const inputSlider = document.getElementById('resolution')
const inputSliderLabel = document.getElementById('resolutionLabel')
image1.src = 'data:image/png;base64,'

class Cell {
    constructor(x, y, symbol, color) {
        this.x = x
        this.y = y
        this.symbol = symbol
        this.color = color

    }
    draw(ctx) {
        ctx.fillStyle = this.color
        ctx.fillText(this.symbol, this.x, this.y)

    }
}
class AsciiEffect {
    #imageCellArray = []
    #pixels = []
    #ctx
    #width
    #height
    constructor(ctx, width, height) {
        this.#ctx = ctx
        this.#width = width
        this.#height = height
        this.#ctx.drawImage(image1, 0, 0, this.#height, this.#width)
        this.#pixels = this.#ctx.getImageData(0, 0, this.#height, this.#width)

    }
    #convertToSymbol(value) {
        const array = [
            '!', '/', '§', '$', '%', '&', '\\', '(', ')', '=', '?', '*', '<', '<', '#', '|', ';', '~', '@', '`', '´', '©', '«', '»', '¤', '{', '}'
        ]
        if (value > 250) {
            return array[0]
        }
        else if (value > 240) {
            return array[1]
        }
        else if (value > 230) {
            return array[2]
        }
        else if (value > 220) {
            return array[3]
        }
        else if (value > 210) {
            return array[4]
        }
        else if (value > 200) {
            return array[5]
        }
        else if (value > 190) {
            return array[6]
        }
        else if (value > 180) {
            return array[7]
        }
        else if (value > 170) {
            return array[8]
        }
        else if (value > 160) {
            return array[9]
        }
        else if (value > 150) {
            return array[10]
        }
        else if (value > 140) {
            return array[11]
        }
        else if (value > 130) {
            return array[12]
        }
        else if (value > 120) {
            return array[13]
        }
        else if (value > 110) {
            return array[14]
        }
        else if (value > 100) {
            return array[15]
        }
        else if (value > 90) {
            return array[16]
        }
        else if (value > 90) {
            return array[17]
        }
        else if (value > 80) {
            return array[18]
        }
        else if (value > 70) {
            return array[19]
        }
        else if (value > 60) {
            return array[20]
        }
        else if (value > 50) {
            return array[21]
        }
        else if (value > 40) {
            return array[22]
        }
        else if (value > 30) {
            return array[23]
        }
        else if (value > 20) {
            return array[24]
        }
        else if (value > 10) {
            return array[25]
        }
        else if (value < 10) {
            return array[26]
        }

    }

    #scanImage(cellSize) {
        this.#imageCellArray = []
        for (let y = 0; y < this.#pixels.height; y += cellSize) {
            for (let x = 0; x < this.#pixels.width; x += cellSize) {
                const posX = x * 4
                const posY = y * 4
                const pos = (posY * this.#pixels.width) + posX

                if (this.#pixels.data[pos + 3] > 128) {
                    const red = this.#pixels.data[pos]
                    const green = this.#pixels.data[pos + 1]
                    const blue = this.#pixels.data[pos + 2]
                    const total = red + green + blue
                    const avgColorValue = total / 3
                    const color = `rgb(${red} , ${green} , ${blue})`
                    const symbol = this.#convertToSymbol(avgColorValue)
                    this.#imageCellArray.push(new Cell(x, y, symbol, color))

                }
            }
        }

    }
    #drawAscii() {
        this.#ctx.clearRect(0, 0, this.#height, this.#width)
        for (let i = 0; i < this.#imageCellArray.length; i++) {
            this.#imageCellArray[i].draw(this.#ctx)
        }
    }
    draw(cellSize) {
        this.#scanImage(cellSize)
        this.#drawAscii()
    }
}
function handleClick(){
    if (parseInt(inputSlider.value) === 1) {
        inputSliderLabel.textContent = 'Original Image'
        ctx.drawImage(image1, 0, 0, canvas.width, canvas.height)
    }
    else {
        inputSliderLabel.textContent = `Resoultion ${inputSlider.value}px`
        effect.draw(parseInt(inputSlider.value))
    
    }
}
let effect;
inputSlider.addEventListener('change', handleClick)
image1.onload = () => {
    canvas.width = image1.width
    canvas.height = image1.height
    effect = new AsciiEffect(ctx, image1.height, image1.width)
    handleClick()
}
